    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Okefenokee NWR for the next 15 years. This plan
    outlines the Refuge vision and purpose and describes how Okefenokee NWR will contribute
    to the overall mission of the Refuge System. The plan provides an introduction to
    the Refuge, information about the environment, information about  plan development
    and the management direction, and strategies for implementation. Key planning issues
    include: wildlife management, partnerships, resource protection, wilderness value,
    visitor services, and Refuge administration.",nt"license_title": "License
